import React from "react";
import Navigation from "./Navigation";

const Header = () => {
  return (
    <header className={'d-flex background-color: rgba(60, 69, 67, .6)'}>
      <Navigation />
      <h1>Luke SkyWalker</h1>
    </header>
  );
};

export default Header;
